const { default: AdminBro } = require('admin-bro');
const { User }              = require('./user.entity')
const { 
    after: passwordAfterHook,
     before: passwordBeforeHook
     } = require('./actions/password.hook')

/** @type {import('admin-bro').AdminBroOptions}  */

const options = {
    properties: {
        encryptedPassword: {
            isVisible: false,
        },
        password: {
            type: 'password',
        },
    },
    actions: {
       
        new: {      
            after : passwordAfterHook,
            before : passwordBeforeHook
        } ,
        edit: {
            after : passwordAfterHook,
            before : passwordBeforeHook
        }
    }
};

module.exports = {
    options,
    resource : User
}

