const express = require('express');
const { default: AdminBro } = require('admin-bro');
const mongoose = require('mongoose')
const bodyParser = require('body-parser');
const options = require('./admin.options');
const buildAdminRouter = require('./admin.router');

const dotenv = require('dotenv');
const config = require('../config');
const path = require('path')
const data1 = require('../data1')

const Product = require('./models/productmodel');
const Manufacture = require('./models/manufacturemodel')

dotenv.config({ path: path.resolve(__dirname, '../.env')});
const app = express();
const PORT = process.env.PORT || 5000;
//AdminBro.registerAdapter(AdminBroMongoose)









const run = async () => {
    const mongodbUrl = config.MONGODB_URL;
     await mongoose.connect('mongodb://localhost/ozkanmakina', {
        useNewUrlParser: true,
        useUnifiedTopology: true,
        useCreateIndex: true
    })
    const admin = new AdminBro (options)
 
    const router = buildAdminRouter(admin)
    //const router = AdminBroExpress.buildRouter(adminBro)
app.use(admin.options.rootPath, router)

app.use(bodyParser.json());
app.use(bodyParser.urlencoded({ extended: false }));





router.get("/api/urunler/:id", async (req, res) => {
    const product = await Product.findOne({ _id: req.params.id })
    if(product) {
        res.send(product);
    } else {
        res.status(404).send({msg: "Ürün Bulunamadı."})
    }
});

app.get("/api/uretim/:id", (req, res) => {
    const manufactureId = req.params.id;
    const manufacture = data1.manufactures.find(x => x._id === manufactureId);
    if(manufacture) {
        res.send(manufacture);
    } else {
        res.status(404).send({msg: "Ürün Bulunamadı."})
    }
});

/*app.get("/api/urunler", (req, res) => {
    res.send(data.products);
})*/

app.get("/api/urunler", async (req, res) => {
    try{
        const products = await Product.find({});
        res.send(products);
    } catch (e) {
        res.status(400).json({msg: e.message})
    }

});

app.get("/api/uretim", async (req, res) => {
    try{
      //  const manufactures = await Manufacture.find({});
        res.send(data1.manufactures);
    } catch (e) {
        res.status(400).json({msg: e.message})
    }
})

app.listen(PORT, () => console.log(
    `Example app listening at http://localhost:${PORT}`,
  ));
};


module.exports = run;

